def is_subsequence(str1, str2):
    str1_len_1 = len(str1)
    str1_len_2 = len(str2)
    idx1 = idx2 = 0

    if not str1: return True
    if not str2: return False

    while idx1 < str1_len_1 and idx2 < str1_len_2:
        if str1[idx1] == str2[idx2]:
            idx1 += 1
            idx2 += 1
            continue
        idx2 += 1
    return idx1 == str1_len_1

